import React from "react";

export default function AddMsg({addChat}){
    let msg='';
    const onChange=(event)=>{
        msg=event.target.value;
    }
    const onClicked=()=>{
        addChat(msg)
    }
    return(
        <div>
            <form>
                <input type='text' onChange={onChange}></input>
                <input type='button' onClick={()=>onClicked}></input>
            </form>
        </div>
    )
}
